social_posts.post_text:
From the first time I posted this cover of ‘Dare You To Move’ to it coming out this week has been such a fun ride. I never planned to release it, but I’m so glad that its out now! Thank you to everyone who helped make that happen…

@switchfoot - thank y’all for being so cool and supportive of this since the beginning. I don’t know if y’all realize, but y’all were one of my first favorite bands 🤯 So, to see y’all commenting and sending me messages about this cover has been the best kind of crazy. 

@andyskib - thank you for dreaming this up with me on a day that we were supposed to write but got canceled on 😂 and for making this (and everything else you produce) sound incredible 

Lastly, thank you guys! Your comments and shares are truly the reason I put this song out. I don’t think I’ve ever had a song connect with so many people via social media. It has been really special for me 🤍

Lastly, how about I release another brand new original song in a few weeks?? 👀🤍 love y’all
